import {StyleSheet} from 'react-native';

const styles = StyleSheet.create({
    container:{
        flex: 1
    },
    titulo:{
        fontSize: 40,
        fontFamily: 'Verdana',
        textAlign: 'center'
    },
    caixa:{
        width: 300,
        height: 300,
        borderWidth: 1,
        borderColor: '#222'
    }
})

export {styles};
